import { makeStyles, Theme } from "@material-ui/core/styles";

const useStyles = makeStyles((theme: Theme) => ({
    root: {
    },
    subtitle: {
        marginBottom: `${theme.spacing(1)}px`,
        lineHeight: '21px',
        fontSize: '14px',
    }

}));
export default useStyles;
